using easy.Helper;
using MCommon;
using Newtonsoft.Json;
using Newtonsoft.Json.Linq;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Windows.Forms;

namespace easy
{
    public class Language
    {
        public static JObject dataJson = JObject.Parse(File.ReadAllText("settings\\" + "lang.json"));

        public static string typeLang = ConfigHelper.GetLanguage();

        private static object _lock = new object();

        public static string GetValue(string key)
        {
            string result = key;

            if (typeLang == "vi")
            {
                if (!dataJson.ContainsKey(key))
                {
                    // Không có
                    lock (_lock)
                    {
                        dataJson.Add(key, "");
                        File.WriteAllText(@"settings\lang.json", dataJson.ToString());
                    }

                }

                return key;
            }

            try
            {
                if (dataJson.ContainsKey(key))
                {
                    if (typeLang == "en")
                    {
                        result = dataJson[key].Value<string>();
                    }
                    
                } else
                {
                    // Không có
                    lock (_lock)
                    {
                        dataJson.Add(key, "");
                        File.WriteAllText(@"settings\lang.json", dataJson.ToString());
                    }

                    result = key;
                }
            }
            catch (Exception ex)
            {
                result = key;
            }
            return result;
        }

        public static void GetValue(Control control)
        {
            control.Text = Language.GetValue(control.Text);
        }

        public static void GetValue(ToolStripItem control)
        {
            control.Text = Language.GetValue(control.Text);
        }

        public static void GetValue(DataGridViewColumn control)
        {
            control.HeaderText = Language.GetValue(control.HeaderText);
        }

        // public static string data = Common.Base64Decode("").Substring(1);
    }
}
